import "../App.css";
import React, { useState, useEffect } from "react";
import Table from "react-bootstrap/Table";
import axios from "axios";

const CreateSession = () => {
  const [data, setData] = useState([]);

  const createSesssionRequest = {
    method: "POST",
    headers: { "Content-Type": "application/json" },
  };

  try {
    axios
      .post(
        "http://localhost:8080/restaurant/api/v1/createSession/ashutosh.bhardwaj@gmail.com"
      )
      .then((response) => {
        setData({
          sessionId: response.data.name,
          sessionRequestedBy: response.data.id,
        });
        response.json();
        console.log(response);
        console.log(response.data);
        //Adding user to local storage
        localStorage.setItem(
          "sessionId",
          JSON.stringify(response.data.sessionId)
        );
      }).then((json) => setData(json));
  } catch (error) {
    console.error("Error fetching data:", error);
    window.location = "/error"; //This line of code will redirect you once the submission is succeed
  }

  const apiDetails = () => {
    axios
      .post(`http://localhost:8080/restaurant/api/v1/createSession/ashutosh.bhardwaj@gmail.com`)
      .then((response) => {
        return response;
      });
  };

  useEffect(() => {  
    (async () => {
     const response = await apiDetails(); 
     setData({
        name: response.data.name,
        id: response.data.id,
      });
    })();
   }, [])

  return (
    <Table striped bordered hover size="sm">
      <thead>
        <tr>
          <th>Session Id</th>
          <th>Session Requested By</th>
          <th>Status</th>
        </tr>
      </thead>

      <tbody>
        {
          <tr key={data.sessionId}>
            <td>{data.sessionId}</td>
            <td>{data.sessionRequestedBy}</td>
            <td>{data.message}</td>
          </tr>
        }
      </tbody>
    </Table>
  );
};
export default CreateSession;
